        <div className="client">
            <label>Client Name:<input onChange={(event)=>{
                setNombre(event.target.value);
            }} type="text" label="Client Name"></input></label>
            <button onClick={create_client}>Registrar</button>
        </div>
    )
}

const create_client = ()=>{
    Axios.post("http://localhost:3001/create_client",{
      nombre:nombre
    }).then(()=>{
      alert("Client Created");
    });
  }
